records.addlTxt:
Defendant in custody.
GUILTY plea entered to the  charge of possess lorazepam with intent to deliver.  Convicted.
Sentence Withheld.  Defendant is placed on probation to DOC for three (3) years.
Conditions of probation:
1) Spend fifteen (15) days in the county jail, under the Huber Law, commencing immediately;
2) additional forty-five (45) days in jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court;
3) seek and obtain a high school diploma or its equivalent;
4) AODA assessment and follow through;
5) Submit to random urine screens and pay for same;
6) Maintain fulltime employment, schooling or combination;
7) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
8) Pay court costs;
9) pay supervision fees in an amount to be determined by DOC;
10) provide DNA sample and pay surcharge.
Expungement is ordered under Section 973.015 upon successful completion of the sentence and defendant having no additional criminal complaint filed against him..  The Court finds that the defendant will benefit and society will not be harmed by expungment in this matter.
Minutes.
